package main

import (
	"bufio"
	"bytes"
	"encoding/hex"
	"io"
	"net/http"
	"testing"
)

func TestHttpReadResponseChunked(t *testing.T) {
	data, _ := hex.DecodeString(``)
	resp, err := http.ReadResponse(bufio.NewReader(bytes.NewReader(data)), nil)
	//assert.NoErr(t, err)
	if err != nil {
		t.Fatal(err)
	}
	t.Log(resp)
	defer resp.Body.Close()

	d, err := io.ReadAll(resp.Body)
	if err != nil {
		t.Fatal(err)
	}
	t.Log(string(d))
}
